description.plain:
Hazey Eyes' remix of “Six Feet Under” is a fast-paced re-imagining of Eilish’s smooth track. It features additional synths, electronic elements, and glistening  beat drops.
Eilish herself sang praises for the rework under the track’s Soundcloud page, saying;

“This remix makes me think of a group of puppies running through a puddle of water in slow motion, and I love it.

